void VirtualizationHeadphones::LoadFilter(Coefficients::VirtualChannels channel, Eigen::Ref<Eigen::ArrayXXf> filter)
{

	if (filter.rows() != FilterSize * D.ScaleFactor)
	{
		filter.setZero(); // if size mismatch
		return;
	}
	
	Eigen::ArrayXXf filterData = Eigen::ArrayXXf::Zero(FilterSize, 2);
	if (C.SampleRate == C.Hz44100 || C.SampleRate == C.Hz88200 || C.SampleRate == C.Hz176400) 
	{
		switch (channel)
		{
		case Coefficients::FrontLeft: filterData = Eigen::Map<Eigen::ArrayXXf>(IR_fs44100_Len256_FrontLeft, FilterSize, 2); break;
		case Coefficients::FrontRight: filterData = Eigen::Map<Eigen::ArrayXXf>(IR_fs44100_Len256_FrontRight, FilterSize, 2); break;
		case Coefficients::BackLeft: filterData = Eigen::Map<Eigen::ArrayXXf>(IR_fs44100_Len256_BackLeft, FilterSize, 2); break;
		case Coefficients::BackRight: filterData = Eigen::Map<Eigen::ArrayXXf>(IR_fs44100_Len256_BackRight, FilterSize, 2); break;
		case Coefficients::Center: filterData = Eigen::Map<Eigen::ArrayXXf>(IR_fs44100_Len256_Center, FilterSize, 2); break;
		}
	}
	else if (C.SampleRate == C.Hz48000 || C.SampleRate == C.Hz96000 || C.SampleRate == C.Hz192000)
	{
		switch (channel)
		{
		case Coefficients::FrontLeft: filterData = Eigen::Map<Eigen::ArrayXXf>(IR_fs48000_Len256_FrontLeft, FilterSize, 2); break;
		case Coefficients::FrontRight: filterData = Eigen::Map<Eigen::ArrayXXf>(IR_fs48000_Len256_FrontRight, FilterSize, 2); break;
		case Coefficients::BackLeft: filterData = Eigen::Map<Eigen::ArrayXXf>(IR_fs48000_Len256_BackLeft, FilterSize, 2); break;
		case Coefficients::BackRight: filterData = Eigen::Map<Eigen::ArrayXXf>(IR_fs48000_Len256_BackRight, FilterSize, 2); break;
		case Coefficients::Center: filterData = Eigen::Map<Eigen::ArrayXXf>(IR_fs48000_Len256_Center, FilterSize, 2); break;
		}
	}

	if (C.SampleRate == C.Hz44100 || C.SampleRate == C.Hz48000) 
	{ 
		filter = filterData; 
		return;
	}
	auto p = Upsampling.GetParameters();
	if (C.SampleRate == C.Hz88200 || C.SampleRate == C.Hz96000) 
	{ 
		p.UpsamplingFactorPow2 = 1;	// 2^1 = 2 x upsampling 
		filterData /= 2;
	} 
	else if (C.SampleRate == C.Hz176400 || C.SampleRate == C.Hz192000) 
	{ 
		p.UpsamplingFactorPow2 = 2; // 2^2 = 4 x upsampling 
		filterData /= 4;
	} 
	Upsampling.SetParameters(p);
	Upsampling.Process(filterData, filter);

	// add impulse above old Nyquist rate. This part is hardcoded.
	if (C.SampleRate == C.Hz88200 || C.SampleRate == C.Hz96000)
	{
		filter.middleRows(21, 17) += Eigen::Map<Eigen::ArrayXf>(Impulse2, 17).replicate(1, 2);
	}
	else if (C.SampleRate == C.Hz176400 || C.SampleRate == C.Hz192000)
	{
		filter.middleRows(39, 17) += Eigen::Map<Eigen::ArrayXf>(Impulse4, 17).replicate(1, 2);
	}
}
